import "./Navbar.css"
function Navbar() {

  const[menu,setMenu]=useState("home");
  return (
    <>
      <div className="Navbar">
        <ul className="nav-menu">
          <li><p onClick={()=>setMenu("home")}>Home </p></li>
          <li><p onClick={()=>setMenu("abou")}>About Me</p></li>
          <li><p onClick={()=>setMenu("")}>Services</p></li>
          <li><p onClick={()=>setMenu("")}>Portfolio</p></li>
          <li><p onClick={()=>setMenu("")}>Contact</p></li>
        </ul>
        <div className="nav-conect">Connect With Me</div>
      </div>
    </>
  );
}

export default Navbar;
